import styled from "styled-components";

export const Container = styled.div`
  width: 100%;
  height: 100vh;
  background-color: #cacaca;
  display: flex;
  align-itemns: center;
  flex-direction: column;
  justify-content: center;
  padding-top: 10%;
`;
